    <NavLink activeStyle={activeStyle} exact to="/">
      Home
    </NavLink>
    {" | "}
    <NavLink activeStyle={activeStyle} to="/view">
      View Coupon
    </NavLink>
    {" | "}
    <NavLink activeStyle={activeStyle} to="/about">
      About
    </NavLink>
  </nav>


  );
}

export default Header;
